import React from 'react';
import './Climb.css';

function Climb() {
    const[values, setValues] = useState({
        username: '',
        gym: '',
        climbType: '',
        grade: '',
        rating: '',
    })

    return (
        <div className="climb-container">

            <div className='climb-item'>
                User 
            </div>
            <div className='climb-item'>
                Type
            </div>
            <div className='climb-item'>
                Gym 
            </div>
            <div className='climb-item'>
                Grade
            </div>
            <div className='climb-item'>
                Rating 
            </div>
        </div>
    );
}

export default Climb;
